import{_ as t}from"./chunks/position_fixed.t2m3lWVy.js";import{_ as i}from"./chunks/rtl_cone.DihiHN2J.js";import{_ as a,c as n,a8 as r,o}from"./chunks/framework.BDnHobkS.js";const T=JSON.parse('{"title":"Режим повернення (типовий транспорт)","description":"","frontmatter":{},"headers":[],"relativePath":"uk/flight_modes/return.md","filePath":"uk/flight_modes/return.md"}'),l={name:"uk/flight_modes/return.md"};function s(d,e,h,m,c,u){return o(),n("div",null,e[0]||(e[0]=[r('<h1 id="режим-повернення-типовии-транспорт" tabindex="-1">Режим повернення (типовий транспорт) <a class="header-anchor" href="#режим-повернення-типовии-транспорт" aria-label="Permalink to &quot;Режим повернення (типовий транспорт)&quot;">​</a></h1><img src="'+t+'" title="Position fix required (e.g. GPS)" width="30px"><p>The <em>Return</em> flight mode is used to <em>fly a vehicle to safety</em> on an unobstructed path to a safe destination, where it should land.</p><p>Наступні теми слід прочитати першими, якщо ви використовуєте ці типи транспортних засобів:</p><ul><li><a href="./../flight_modes_mc/return.html">Multicopter</a></li><li><a href="./../flight_modes_fw/return.html">Fixed-wing (Plane)</a></li><li><a href="./../flight_modes_vtol/return.html">VTOL</a></li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><ul><li>Режим автоматичний - для керування апаратом не потрібно втручання користувача.</li><li>Режим вимагає глобальної оцінки 3D-позиції (з GPS або виведеної з <a href="./../ros/external_position_estimation.html#enabling-auto-modes-with-a-local-position">локальної позиції</a>). <ul><li>Літаючі транспортні засоби не можуть переключатися на цей режим без глобального положення.</li><li>Літаючі транспортні засоби перейдуть в режим аварійної безпеки, якщо втратять оцінку положення.</li></ul></li><li>Режим вимагає встановленої домашньої позиції.</li><li>Режим перешкоджає зброюванню (транспортний засіб повинен бути зброєний при переході на цей режим).</li><li>Перемикачі керування RC можуть використовуватися для зміни режимів польоту на будь-якому транспортному засобі.</li><li>RC stick movement in a multicopter (or VTOL in multicopter mode) will <a href="#COM_RC_OVERRIDE">by default</a> change the vehicle to <a href="./../flight_modes_mc/position.html">Position mode</a> unless handling a critical battery failsafe.</li><li>VTOL повернеться як MC або FW на основі свого режиму в точці, коли режим повернення було запущено. У режимі багтороторного літання він буде дотримуватися параметрів багтороторного літання, таких як &quot;конус&quot; посадки. У режимі ФПВ він буде дотримуватися параметрів фіксованого крила (ігнорувати конус), але, якщо не використовується місійна посадка, перейде в режим багтороторного літання та посадиться у пункт призначення після нависання на висоті спуску.</li></ul></div><h2 id="загальнии-огляд" tabindex="-1">Загальний огляд <a class="header-anchor" href="#загальнии-огляд" aria-label="Permalink to &quot;Загальний огляд&quot;">​</a></h2><p>PX4 надає кілька механізмів для вибору безпечного шляху повернення, пункту призначення та посадки, включаючи використання домашнього місця, точок ралі (&quot;безпечні&quot;), шляхів місії та послідовностей посадки, визначених у місії.</p><p>All vehicles <em>nominally</em> support all of these mechanisms, but not all of them make as much sense for particular vehicles. Наприклад, багатокоптер може приземлитися практично будь-де, тому використання послідовності посадки для нього не має сенсу, крім випадків, які трапляються рідко. Так само, фіксований крилообразний транспортний засіб повинен пролетіти безпечний шлях до посадки: він може використовувати домашнє місце як точку повернення, але за замовчуванням не буде намагатися приземлитися на ньому.</p><p>This topic covers all the possible return types that any vehicle <em>might</em> be configured to use — the vehicle-specific return mode topics cover the default/recommended return type and configuration for each vehicle.</p><p>The following sections explain how to configure the <a href="#return_types">return type</a>, <a href="#minimum-return-altitude">minimum return altitude</a> and <a href="#loiter-landing-at-destination">landing/arrival behaviour</a>.</p><p><a id="return_types"></a></p><h2 id="типи-повернень-rtl-type" tabindex="-1">Типи повернень (RTL_TYPE) <a class="header-anchor" href="#типи-повернень-rtl-type" aria-label="Permalink to &quot;Типи повернень (RTL_TYPE)&quot;">​</a></h2><p>PX4 provides four alternative approaches for finding an unobstructed path to a safe destination and/or landing, which are set using the <a href="#RTL_TYPE">RTL_TYPE</a> parameter.</p><p>На високому рівні є:</p><ul><li><a href="#home_return">Home/rally point return</a> (<code>RTL_TYPE=0</code>): Ascend to safe altitude and return via a direct path to the closest rally point or home location.</li><li><a href="#mission-landing-rally-point-return-type-rtl-type-1">Mission landing/rally point return</a> (<code>RTL_TYPE=1</code>): Ascend to a safe altitude, fly direct to the closest destination <em>other than home</em>: rally point or start of mission landing. Якщо не визначено пунктів посадки або збору місії, поверніться додому прямим шляхом.</li><li><a href="#mission-path-return-type-rtl-type-2">Mission path return</a> (<code>RTL_TYPE=2</code>): Use mission path and fast-continue to mission landing (if defined). If no mission <em>landing</em> defined, fast-reverse mission to home. If no <em>mission</em> defined, return direct to home (rally points are ignored).</li><li><a href="#closest-safe-destination-return-type-rtl-type-3">Closest safe destination return</a> (<code>RTL_TYPE=3</code>): Ascend to a safe altitude and return via direct path to closest destination: home, start of mission landing pattern, or rally point. Якщо пунктом призначення є схема приземлення, дотримуйтеся цієї схеми, щоб приземлитися.</li></ul><p>Більш детальні пояснення щодо кожного з типів наведено в наступних розділах.</p><p><a id="home_return"></a></p><h3 id="тип-повернення-додому-точка-збору-rtl-type-0" tabindex="-1">Тип повернення додому/точка збору (RTL_TYPE=0) <a class="header-anchor" href="#тип-повернення-додому-точка-збору-rtl-type-0" aria-label="Permalink to &quot;Тип повернення додому/точка збору (RTL_TYPE=0)&quot;">​</a></h3><p>This is the default return type for a <a href="./../flight_modes_mc/return.html">multicopter</a> (see topic for more information).</p><p>У цьому типі повернення транспортний засіб:</p><ul><li>Ascends to a safe <a href="#minimum-return-altitude">minimum return altitude</a> (above any expected obstacles).</li><li>Летить прямою траєкторією до вихідної позиції або точки збору (залежно від того, що ближче)</li><li>On <a href="#loiter-landing-at-destination">arrival</a> descends to &quot;descent altitude&quot; and waits for a configurable time. Цей час можна використати для розгортання шасі для посадки.</li><li>Lands or waits (this depends on landing parameters), By default an MC or VTOL in MC mode will land and a fixed-wing vehicle circles at the descent altitude. ВТОЛ у режимі FW вирівнює свою орієнтацію на точку призначення, переходить у режим МБ і потім приземлюється.</li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p>If no rally points are defined, this is the same as a <em>Return to Launch</em> (RTL)/<em>Return to Home</em> (RTH).</p></div><h3 id="тип-посадки-повернення-точки-збору-rtl-type-1" tabindex="-1">Тип посадки/повернення точки збору (RTL_TYPE=1) <a class="header-anchor" href="#тип-посадки-повернення-точки-збору-rtl-type-1" aria-label="Permalink to &quot;Тип посадки/повернення точки збору (RTL_TYPE=1)&quot;">​</a></h3><p>This is the default return type for a <a href="./../flight_modes_fw/return.html">fixed-wing</a> or <a href="./../flight_modes_vtol/return.html">VTOL</a> vehicle (see topics for more information).</p><p>У цьому типі повернення транспортний засіб:</p><ul><li>Ascends to a safe <a href="#minimum-return-altitude">minimum return altitude</a> (above any expected obstacles) if needed. Транспортний засіб підтримує свою початкову висоту, якщо вона вище, ніж мінімальна висота повернення.</li><li>Flies via direct constant-altitude path to a rally point or the start of a <a href="#mission-landing-pattern">mission landing pattern</a> (whichever is closest). Якщо місця посадки або збору не визначені, транспортний засіб повертається додому прямим шляхом.</li><li>Якщо призначенням є місійний маршрут посадки, апарат буде дотримуватися маршруту для посадки.</li><li>If the destination is a rally point or home it will <a href="#loiter-landing-at-destination">land or wait</a> at descent altitude (depending on landing parameters). За замовчуванням багатороторні квадрокоптери або вертикально-взлітно-посадкові літаки в режимі багатороторника приземлюються, а фіксованокрилі літаки обертаються на висоті спуску. ВТОЛ у режимі FW вирівнює свою орієнтацію на точку призначення, переходить у режим МБ і потім приземлюється.</li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Fixed wing vehicles commonly also set <a href="#MIS_TKO_LAND_REQ">MIS_TKO_LAND_REQ</a> to <em>require</em> a mission landing pattern.</p></div><h3 id="тип-повернення-маршруту-завдання-rtl-type-2" tabindex="-1">Тип повернення маршруту завдання (RTL_TYPE=2) <a class="header-anchor" href="#тип-повернення-маршруту-завдання-rtl-type-2" aria-label="Permalink to &quot;Тип повернення маршруту завдання (RTL_TYPE=2)&quot;">​</a></h3><p>This return type uses the mission (if defined) to provide a safe return <em>path</em>, and the <a href="#mission-landing-pattern">mission landing pattern</a> (if defined) to provide landing behaviour. If there is a mission but no mission landing pattern, the mission is flown <em>in reverse</em>. Точки ралі, якщо вони є, ігноруються.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The behaviour is fairly complex because it depends on the flight mode, and whether a mission and mission landing are defined.</p></div><p>Mission <em>with</em> landing pattern:</p><ul><li><strong>Mission mode:</strong> Mission is continued in &quot;fast-forward mode&quot; (jumps, delay and any other non-position commands ignored, loiter and other position waypoints converted to simple waypoints) and then lands.</li><li><strong>Auto mode other than mission mode:</strong><ul><li>Ascend to a safe <a href="#minimum-return-altitude">minimum return altitude</a> above any expected obstacles.</li><li>Летіть безпосередньо до найближчої точки маршруту (для FW - не посадкової точки) і знижуйтеся до висоти точки маршруту.</li><li>Продовжуйте місію в режимі швидкої відтворення з цієї точки маршруту.</li></ul></li><li><strong>Manual modes:</strong><ul><li>Ascend to a safe <a href="#minimum-return-altitude">minimum return altitude</a> above any expected obstacles.</li><li>Прямий польот до позиції послідовності посадки та спуск до висоти позначеної точки</li><li>Приземлення з використанням місійного шаблону посадки</li></ul></li></ul><p>Mission <em>without</em> landing pattern defined:</p><ul><li><strong>Mission mode:</strong><ul><li>Місія виконується &quot;швидко назад&quot; (у зворотному напрямку) починаючи з попередньої точки маршруту <ul><li>Переходи, затримки та будь-які інші команди, що не стосуються позиції, ігноруються. Точки залишку та інші позиційні точки перетворюються на прості точки маршруту.</li><li>Транспортні засоби VTOL переходять у режим FW (за потреби) перед тим, як летіти місію задом наперед.</li></ul></li><li>On reaching waypoint 1, the vehicle ascends to the <a href="#minimum-return-altitude">minimum return altitude</a> and flies to the home position (where it <a href="#loiter-landing-at-destination">lands or waits</a>).</li></ul></li><li><strong>Auto mode other than mission mode:</strong><ul><li>Летіть безпосередньо до найближчої точки маршруту (для FW - не посадкової точки) і знижуйтеся до висоти точки маршруту.</li><li>Продовжуйте місію у зворотному напрямку, точно так само, як буде активовано режим Повернення у режимі місії (див. вище)</li></ul></li><li><strong>Manual modes:</strong> Fly directly to home location and land.</li></ul><p>Якщо місія не визначена, PX4 буде летіти безпосередньо до домашньої локації та приземлиться (точки ралі ігноруються).</p><p>Якщо місія змінюється під час режиму повернення, тоді поведінка повторно оцінюється на основі нової місії за тими ж правилами, що й вище (наприклад, якщо нова місія не має послідовності приземлення, а ви в місії, місія змінюється).</p><h3 id="тип-повернення-додому-точка-збору-rtl-type-3" tabindex="-1">Тип повернення додому/точка збору (RTL_TYPE=3) <a class="header-anchor" href="#тип-повернення-додому-точка-збору-rtl-type-3" aria-label="Permalink to &quot;Тип повернення додому/точка збору (RTL_TYPE=3)&quot;">​</a></h3><p>У цьому типі повернення транспортний засіб:</p><ul><li>Ascends to a safe <a href="#minimum-return-altitude">minimum return altitude</a> (above any expected obstacles).</li><li>Летить прямо до найближчої точки призначення: домашньої локації, шаблону посадки місії або точки ралі.</li><li>If the destination is a <a href="#mission-landing-pattern">mission landing pattern</a> the vehicle will follow the pattern to land.</li><li>If the destination is a home location or rally point, the vehicle will descend to the descent altitude (<a href="#RTL_DESCEND_ALT">RTL_DESCEND_ALT</a>) and then <a href="#loiter-landing-at-destination">lands or waits</a>. За замовчуванням багатороторні квадрокоптери або вертикально-взлітно-посадкові літаки в режимі багатороторника приземлюються, а фіксованокрилі літаки обертаються на висоті спуску. ВТОЛ у режимі FW вирівнює свою орієнтацію на точку призначення, переходить у режим МБ і потім приземлюється.</li></ul><h2 id="мінімальна-висота-повернення" tabindex="-1">Мінімальна висота повернення <a class="header-anchor" href="#мінімальна-висота-повернення" aria-label="Permalink to &quot;Мінімальна висота повернення&quot;">​</a></h2><p>For most <a href="#return_types">return types</a> a vehicle will ascend to a <em>minimum safe altitude</em> before returning (unless already above that altitude), in order to avoid any obstacles between it and the destination.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The exception is when executing a <a href="#mission-path-return-type-rtl-type-2">mission path return</a> from <em>within a mission</em>. У цьому випадку транспортний засіб слідує точкам маршруту місії, які ми припускаємо, що сплановані таким чином, щоб уникнути будь-яких перешкод.</p></div><p>The return altitude for a fixed-wing vehicle or a VTOL in fixed-wing mode is configured using the parameter <a href="#RTL_RETURN_ALT">RTL_RETURN_ALT</a> (does not use the code described in the next paragraph).</p><p>The return altitude for a multicopter or a VTOL vehicles in MC mode is configured using the parameters <a href="#RTL_RETURN_ALT">RTL_RETURN_ALT</a> and <a href="#RTL_CONE_ANG">RTL_CONE_ANG</a>, which define a half cone centered around the destination (home location or safety point).</p><p><img src="'+i+'" alt="Режим повернення конуса"></p><p>Якщо транспорт є:</p><ul><li>Above <a href="#RTL_RETURN_ALT">RTL_RETURN_ALT</a> (1) it will return at its current altitude.</li><li>Below the cone it will return where it intersects the cone (2) or <a href="#RTL_DESCEND_ALT">RTL_DESCEND_ALT</a> (whichever is higher).</li><li>Outside the cone (3) it will first climb until it reaches <a href="#RTL_RETURN_ALT">RTL_RETURN_ALT</a>.</li><li>У межах конуса: <ul><li>Above <a href="#RTL_DESCEND_ALT">RTL_DESCEND_ALT</a> (4) it will return at its current altitude.</li><li>Below <a href="#RTL_DESCEND_ALT">RTL_DESCEND_ALT</a> (5) it will first ascend to <code>RTL_DESCEND_ALT</code>.</li></ul></li></ul><p>Примітка:</p><ul><li>If <a href="#RTL_CONE_ANG">RTL_CONE_ANG</a> is 0 degrees there is no &quot;cone&quot;: <ul><li>the vehicle returns at <code>RTL_RETURN_ALT</code> (or above).</li></ul></li><li>If <a href="#RTL_CONE_ANG">RTL_CONE_ANG</a> is 90 degrees the vehicle will return at the greater of <code>RTL_DESCEND_ALT</code> and the current altitude.</li><li>The vehicle will always ascend at least <a href="#RTL_DESCEND_ALT">RTL_DESCEND_ALT</a> for the return.</li></ul><h2 id="посадка-в-пункті-призначення" tabindex="-1">Посадка в пункті призначення <a class="header-anchor" href="#посадка-в-пункті-призначення" aria-label="Permalink to &quot;Посадка в пункті призначення&quot;">​</a></h2><p>Unless executing a <a href="#mission-landing-pattern">mission landing pattern</a> as part of the return mode, the vehicle will arrive at its destination, and rapidly descend to the <a href="#RTL_DESCEND_ALT">RTL_DESCEND_ALT</a> altitude, where it will loiter for <a href="#RTL_LAND_DELAY">RTL_LAND_DELAY</a> before landing. If <code>RTL_LAND_DELAY=-1</code> it will loiter indefinitely.</p><p>Конфігурація за замовчуванням для посадки залежить від типу транспортного засобу:</p><ul><li>Багтороторні літальні апарати налаштовані на коротку паузу в горизонтальному положенні, розкладаючи стійки посадкової шасі за потреби, а потім сідають.</li><li>Fixed-wing vehicles use a return mode with a <a href="#mission-landing-pattern">mission landing pattern</a>, as this enables automated landing. Якщо не використовується посадка за допомогою місії, конфігурація за замовчуванням полягає в нескінченному обертанні, щоб користувач міг взяти керування власноруч і виконати посадку.</li><li>VTOLи в режимі MC літають і сідають точно так само, як багтороторний вертоліт.</li><li>VTOLи в режимі FW рухаються до точки посадки, переходять у режим MC, а потім сідають на місце призначення.</li></ul><h2 id="схема-посадки-місіі" tabindex="-1">Схема посадки місії <a class="header-anchor" href="#схема-посадки-місіі" aria-label="Permalink to &quot;Схема посадки місії&quot;">​</a></h2><p>Шаблон посадки місії - це шаблон посадки, визначений як частина плану місії. This consists of a <a href="https://mavlink.io/en/messages/common.html#MAV_CMD_DO_LAND_START" target="_blank" rel="noreferrer">MAV_CMD_DO_LAND_START</a>, one or more position waypoints, and a <a href="https://mavlink.io/en/messages/common.html#MAV_CMD_NAV_LAND" target="_blank" rel="noreferrer">MAV_CMD_NAV_LAND</a> (or <a href="https://mavlink.io/en/messages/common.html#MAV_CMD_NAV_VTOL_LAND" target="_blank" rel="noreferrer">MAV_CMD_NAV_VTOL_LAND</a> for a VTOL Vehicle).</p><p>Landing patterns defined in missions are the safest way to automatically land a <em>fixed-wing</em> vehicle on PX4. For this reason fixed-wing vehicles are configured to use <a href="#mission-landing-rally-point-return-type-rtl-type-1">Mission landing/really point return</a> by default.</p><h2 id="параметри" tabindex="-1">Параметри <a class="header-anchor" href="#параметри" aria-label="Permalink to &quot;Параметри&quot;">​</a></h2><p>The RTL parameters are listed in <a href="./../advanced_config/parameter_reference.html#return-mode">Parameter Reference &gt; Return Mode</a> (and summarised below).</p><table tabindex="0"><thead><tr><th>Параметр</th><th>Опис</th></tr></thead><tbody><tr><td><a id="RTL_TYPE"></a><a href="./../advanced_config/parameter_reference.html#RTL_TYPE">RTL_TYPE</a></td><td>Return mechanism (path and destination).<br><code>0</code>: Return to a rally point or home (whichever is closest) via direct path.<br><code>1</code>: Return to a rally point or the mission landing pattern start point (whichever is closest), via direct path. Якщо не визначено ні місійної посадки, ні точок ралі, повертайтеся додому через прямий шлях. If the destination is a mission landing pattern, follow the pattern to land.<br><code>2</code>: Use mission path fast-forward to landing if a landing pattern is defined, otherwise fast-reverse to home. Ігноруємо точки ралі. Fly direct to home if no mission plan is defined.<br><code>3</code>: Return via direct path to closest destination: home, start of mission landing pattern or safe point. Якщо пунктом призначення є схема приземлення, дотримуйтеся цієї схеми, щоб приземлитися.</td></tr><tr><td><a id="RTL_RETURN_ALT"></a><a href="./../advanced_config/parameter_reference.html#RTL_RETURN_ALT">RTL_RETURN_ALT</a></td><td>Повернути висоту в метрах (за замовчуванням: 60м), коли <a href="./../advanced_config/parameter_reference.html#RTL_CONE_ANG">RTL_CONE_ANG</a> дорівнює 0. Якщо вже вище цієї величини, транспортний засіб повернеться на поточну висоту.</td></tr><tr><td><a id="RTL_DESCEND_ALT"></a><a href="./../advanced_config/parameter_reference.html#RTL_DESCEND_ALT">RTL_DESCEND_ALT</a></td><td>Мінімальна висота повернення і висота, на якій повітряне судно сповільнює або зупиняє своє початкове зниження з вищої висоти повернення (за замовчуванням: 30 м)</td></tr><tr><td><a id="RTL_LAND_DELAY"></a><a href="./../advanced_config/parameter_reference.html#RTL_LAND_DELAY">RTL_LAND_DELAY</a></td><td>Time to wait at <code>RTL_DESCEND_ALT</code> before landing (default: 0.5s) -by default this period is short so that the vehicle will simply slow and then land immediately. Якщо встановлено значення -1, система буде кружляти на висоті <code>RTL_DESCEND_ALT</code> замість посадки. Затримка надається для того, щоб ви могли налаштувати час для розгортання шасі для посадки (автоматично спрацьовує).</td></tr><tr><td><a id="RTL_MIN_DIST"></a><a href="./../advanced_config/parameter_reference.html#RTL_MIN_DIST">RTL_MIN_DIST</a></td><td>Мінімальна горизонтальна відстань від домашньої позиції, щоб викликати підйом на висоту повернення, вказану &quot;конусом&quot;. If the vehicle is horizontally closer than this distance to home, it will return at its current altitude or <code>RTL_DESCEND_ALT</code> (whichever is higher) instead of first ascending to RTL_RETURN_ALT.</td></tr><tr><td><a id="RTL_CONE_ANG"></a><a href="./../advanced_config/parameter_reference.html#RTL_CONE_ANG">RTL_CONE_ANG</a></td><td>Половина кута конуса, який визначає висоту повернення транспортного засобу RTL. Значення (у градусах): 0, 25, 45, 65, 80, 90. Зауважте, що 0 означає &quot;без конуса&quot; (завжди повертається на висоту <code>RTL_RETURN_ALT</code> або вище), тоді як 90 показує, що транспортний засіб повинен повертатися на поточну висоту або <code>RTL_DESCEND_ALT</code> (яка вище).</td></tr><tr><td><a id="COM_RC_OVERRIDE"></a><a href="./../advanced_config/parameter_reference.html#COM_RC_OVERRIDE">COM_RC_OVERRIDE</a></td><td>Контролює, чи рух палиць на багтрековому літальному апараті (або VTOL у режимі MC) викликає зміну режиму на <a href="./../flight_modes_mc/position.html">Режим позиціонування</a> (крім випадку, коли транспортний засіб вирішує критичне аварійне вимкнення батареї). Це можна окремо увімкнути для автоматичних режимів та для режиму поза бортом, і в автоматичних режимах воно включено за замовчуванням.</td></tr><tr><td><a id="COM_RC_STICK_OV"></a><a href="./../advanced_config/parameter_reference.html#COM_RC_STICK_OV">COM_RC_STICK_OV</a></td><td>Кількість рухів стиків, яка викликає перехід у <a href="./../flight_modes_mc/position.html">режим Положення</a> (якщо <a href="#COM_RC_OVERRIDE">COM_RC_OVERRIDE</a> увімкнено).</td></tr><tr><td><a id="RTL_LOITER_RAD"></a><a href="./../advanced_config/parameter_reference.html#RTL_LOITER_RAD">RTL_LOITER_RAD</a></td><td>[Тільки фіксоване крило] Радіус круга обертання (у значенні <a href="#RTL_LAND_DELAY">RTL_LAND_DELAY</a>).</td></tr><tr><td><a id="MIS_TKO_LAND_REQ"></a><a href="./../advanced_config/parameter_reference.html#MIS_TKO_LAND_REQ">MIS_TKO_LAND_REQ</a></td><td>Вказує, чи <em>необхідний</em> місійний маршрут посадки або зльоту. Зазвичай літаки з фіксованим крилом встановлюють це для вимоги до посадкового маршруту, але VTOL - ні.</td></tr></tbody></table>',60)]))}const L=a(l,[["render",s]]);export{T as __pageData,L as default};
